import BookForm from "./BookForm"
import BooksTable from "./BooksTable"
import { Box} from '@mui/material'

const books = [
    {
        id: 1,
        name: 'Harry Potter',
        author: 'J. K. Rowling'
    },
    {
        id: 2,
        name: 'The Maze Runner',
        author: 'James Dashner'
    }
]


const Books = ()=>{
    return(
        <Box 
            sx={{
                width: 'calc(100%-100px)',
                margin: 'auto',
                marginTop
            }}
        >
            <BookForm/>
            <BooksTable rows={books}/>
        </Box>
        
    )
}
export default Books;
